import { Component, Suspense, lazy } from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import { connect } from 'react-redux';

import Navbar from './client/Navbar/components/Navbar';

import { getCurrentUser } from './redux/auth/auth-operations';
import PrivetRoute from './client/components/PrivetRoute';
import PublicRoute from './client/components/PublicRoute';

const HomePage = lazy(() => import('./client/HomePage'));
const ContactsPage = lazy(() => import('./client/Contacts/pages/ContactsPage'));
const RegisterPage = lazy(() => import('./client/RegisterPage'));
const LoginPage = lazy(() => import('./client/LoginPage'));
const NotFoundPage = lazy(() => import('./client/NotFoundPage'));

class App extends Component {
  componentDidMount() {
    this.props.onGetCurrentUser();
  }
  render() {
    return (
      <BrowserRouter>
        <Navbar />
        <Switch>
          <Route exact path="/" component={HomePage} />
          <PrivetRoute
            exact
            path="/contacts"
            component={ContactsPage}
            redirectTo="/login"
          />
          <PublicRoute
            exact
            path="/register"
            restricted
            redirectTo="/contacts"
            component={RegisterPage}
          />
          <PublicRoute
            exact
            path="/login"
            restricted
            redirectTo="/contacts"
            component={LoginPage}
          />
          <Route component={NotFoundPage} />
        </Switch>
      </BrowserRouter>
    );
  }
}

const mapDispatchToProps = {
  onGetCurrentUser: getCurrentUser,
};

export default connect(null, mapDispatchToProps)(App);
